properties.sitemap.loc:
declare namespace sitemap="http://www.sitemaps.org/schemas/sitemap/0.9";

if (exists(/sitemap:sitemapindex)) then (
    for $x in /sitemap:sitemapindex/sitemap:sitemap/sitemap:loc
    return string($x)
) else (
    for $x in /sitemap:urlset/sitemap:url/sitemap:loc
    return string($x)
)
